import styles from "../styles/Contact.module.css";

function ContactUs() {
  return (
    <div>
      <div className={styles.title}>
        <h1> Contact us</h1>
      </div>
      <div className={styles.container}>
        <div className={styles.details}>
          <h1>Phone</h1>
        </div>
        <div className={styles.location}></div>
      </div>
    </div>
  );
}

export default ContactUs;
